import { StyledCard, Text, Ball, BallIndicator } from './styled';

const Card = ({ results }) => {
  return (
    <>
      { results.map(person => (

        <StyledCard key={person.id}>
          <img src={person.image} alt="" />
          <div>
            <Text title='true'>Rick</Text>
            <Ball>
              <BallIndicator />
              <Text ball='true' >Alive - Human</Text>
            </Ball>
            <Text title='true'>Last known location</Text>
            <Text description='true' >Citadel of Ricks</Text>
            <Text title='true'>First seen in</Text>
            <Text description='true' >Close Rick-counters of the Rick Kind</Text>
          </div>
        </StyledCard>

      ))}
    </>
  );
};


export default Card;
